// src/pages/MedicalVacationPage.js
import React from 'react';
import './MedicalVacationPage.css';
import '../styles/global.css';
import treatmentPackagesImage from './images/treatment-packages.jpg';
import accommodationImage from './images/accommodation.jpg';
import testimonialsImage from './images/testimonials.jpg';

const MedicalVacationPage = () => {
  return (
    <div className="medical-vacation">
      <h1>Medical Vacation</h1>
      <div className="package">
        <img src={treatmentPackagesImage} alt="Treatment Packages" />
        <h2>Treatment Packages</h2>
        <p>Comprehensive medical vacation packages, offering treatments combined with luxurious stay options.</p>
      </div>
      <div className="package">
        <img src={accommodationImage} alt="Accommodation" />
        <h2>Accommodation</h2>
        <p>Luxurious accommodations to ensure a comfortable stay during your treatment.</p>
      </div>
      <div className="package">
        <img src={testimonialsImage} alt="Testimonials" />
        <h2>Testimonials</h2>
        <p>Hear from our satisfied clients about their experiences.</p>
      </div>
    </div>
  );
};

export default MedicalVacationPage;
